import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css';  // Import the CSS file

function Home() {
  return (
    <div className="home-container">
      <h2>Welcome to NSUT DSA Leaderboard</h2>
      <nav>
  <Link to="/login" style={{ margin: '10px 20px' }}>Login</Link>
  <br />
  <Link to="/leaderboard" style={{ margin: '10px 20px' }}>View Leaderboard</Link>
</nav>
    </div>
  );
}

export default Home;
